import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenseItems = [
    {id: 'e1',tittle: "Car Insurence1" , amount:250.5 , date: new Date(2023,1,4)},
    {id: 'e2',tittle: "Car Insurence2" , amount:255.5 , date: new Date(2023,1,4)},
    {id: 'e3',tittle: "Car Insurence3" , amount:260.5 , date: new Date(2023,1,4)}
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
